import React from 'react';
import { Link } from 'react-router-dom';
import './Ticket.css';

const movies = [
  {
    id: 1,
    title: 'The Greatest of All Time',
    genre: 'Action/Drama/Thriller',
    rating: 8.0,
    votes: '115.3K',
    image: 'path-to-greatest-of-all-time-poster.jpg'
  },
  {
    id: 2,
    title: 'Vaazhai',
    genre: 'Drama',
    rating: 8.7,
    votes: '34.5K',
    image: 'path-to-vaazhai-poster.jpg'
  },
  {
    id: 3,
    title: 'Demonte Colony 2 - Vengeance of The Unholy',
    genre: 'Horror/Thriller',
    rating: 8.4,
    votes: '41.1K',
    image: 'path-to-demonte-colony-poster.jpg'
  },
  {
    id: 4,
    title: 'Surya\'s Saturday',
    genre: 'Action/Drama',
    rating: 8.5,
    votes: '9.5K',
    image: 'path-to-suryas-saturday-poster.jpg'
  },
  {
    id: 5,
    title: 'Beetlejuice Beetlejuice',
    genre: 'Comedy/Fantasy/Horror',
    rating: 7.7,
    votes: '284',
    image: 'path-to-beetlejuice-poster.jpg'
  }
];

const MovieList = () => {
  return (
    <div className="movie-list">
      <h2>Recommended Movies</h2>
      <div className="movies">
        {movies.map((movie) => (
          <Link to={`MovieDeta{movie.id}`} key={movie.id} className="movie-card">
            <img src={movie.image} alt={movie.title} className="movie-image" />
            <div className="movie-info">
              <h3>{movie.title}</h3>
              <p>{movie.genre}</p>
              <div className="movie-rating">
                <span>‚≠ê {movie.rating}/10</span>
                <span>{movie.votes} Votes</span>
              </div>
            </div>
          </Link>
        ))}
      </div>
    </div>
  );
};

export default MovieList;
